import React, { Component } from 'react'; 
import './index.css';

export default class ForestDisplay extends Component {
    render() {

        let tree = () => { 
            let trees = "";
            for(let i = 0; i < this.props.treeNum; i++){
                trees.concat(<img src={this.props.treeImg}/>);
            }
            return trees;
        }

        return(
            <div>
                <section className="forest-page">
                        <div className="forest-image">
                            <img id="forest" src="./img/forest.jpg" alt="Your Forest"/>
                            <div id="trees">
                                {tree}
                            </div>
                            <div id="flowers">

                            </div>
                        </div>
                        <br aria-hidden="true"/>
                        <h1>Planned Work Time: <span className="streaks">{this.props.time} Minutes <span role="img" aria-label="fire emoji">ðŸ”¥</span></span></h1>
                    </section>
            </div>
        )
    }
}
